import React, { Component } from 'react';

class Menu extends Component {
	render(){
		return (
			<div>
				<div class="searchBarWidget searchBoxComponent">
				<form id="searchBarWidgetForm" method="get" action="/search">
				<div class="searchBarWidget_filter filter">
				<span class="selected">All fonts</span>
				<div class="arrow-down"></div>
				<ul class="items hidden">
				<li data-filter="all" class="all hidden">All fonts</li>
				<li data-filter="free" class="free">Free fonts</li>
				<li data-filter="webfonts" class="webfonts">Webfonts</li>
				<li data-filter="mls" class="mls">Subscription</li></ul>
				</div><div class="searchBarWidget__query query">
				<input name="q" size="15" placeholder="Search over 130,000 fontsâ€¦and counting!" type="text" autocomplete="off" /><ul class="auto_complete_results hidden"></ul></div>
				<button type="submit" id="searchButton" class="searchBarWidget__searchButton"><span class="-search">Search</span><span class="-searchMobile">GO</span></button></form></div>
			</div>
		)
	}

}

export default Menu;
